      image_url: "https://filmecompleto.com.br/wp-content/uploads/2020/10/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_.jpg"
    }
  ]


  return (

    <Container>
      <h1>Movies</h1>
      <MovieList>
      {movies.map(movie=>{
        return(
          <Movie>
            <a href="#"><img src={movie.image_url}></img></a>
            <span>{movie.title}</span>
            </Movie>
          )
        })}

        </MovieList>
    </Container>)}

